import{o as n,c as s,a}from"./app.f07eb13e.js";const e='{"title":"数据类型","description":"","frontmatter":{},"headers":[{"level":2,"title":"基本数据类型","slug":"基本数据类型"},{"level":3,"title":"string","slug":"string"},{"level":3,"title":"number","slug":"number"},{"level":3,"title":"boolean","slug":"boolean"},{"level":3,"title":"undefined","slug":"undefined"},{"level":3,"title":"null","slug":"null"},{"level":3,"title":"symbol","slug":"symbol"},{"level":3,"title":"bigInt","slug":"bigint"},{"level":2,"title":"引用数据类型","slug":"引用数据类型"},{"level":3,"title":"object","slug":"object"},{"level":3,"title":"array","slug":"array"},{"level":3,"title":"function","slug":"function"}],"relativePath":"article/javascript/data-type.md","lastUpdated":1619806236775}',o={},t=a('<h1 id="数据类型"><a class="header-anchor" href="#数据类型" aria-hidden="true">#</a> 数据类型</h1><p>在<code>JavaScript</code>中，数据类型分为<strong>基本数据类型</strong>和<strong>引用数据类型</strong>。</p><h2 id="基本数据类型"><a class="header-anchor" href="#基本数据类型" aria-hidden="true">#</a> 基本数据类型</h2><p>基本类型（基本数值、基本数据类型）是一种既<strong>非对象</strong>也<strong>无方法</strong>的数据。</p><p>在基本数据类型中，分为以下几种类型。</p><h3 id="string"><a class="header-anchor" href="#string" aria-hidden="true">#</a> <code>string</code></h3><p>字符串类型在<code>JavaScript</code>中是使用<code>&quot;&quot;</code>、<code>&#39;&#39;</code>包裹着的数据类型。示例如下：</p><div class="language-js"><pre><code><span class="token keyword">const</span> str <span class="token operator">=</span> <span class="token string">&#39;1&#39;</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> str1 <span class="token operator">=</span> <span class="token string">&#39;string&#39;</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> str2 <span class="token operator">=</span> <span class="token string">&#39;string2&#39;</span><span class="token punctuation">;</span>\n</code></pre></div><h4 id="字符字面量"><a class="header-anchor" href="#字符字面量" aria-hidden="true">#</a> 字符字面量</h4><p>字符串类型中含有一些字符字面量：</p><table><thead><tr><th>字面量</th><th>含义</th></tr></thead><tbody><tr><td><code>\\n</code></td><td>换行</td></tr><tr><td><code>\\t</code></td><td>制表符</td></tr><tr><td><code>\\b</code></td><td>空格</td></tr><tr><td><code>\\r</code></td><td>回车</td></tr><tr><td><code>\\f</code></td><td>换页符</td></tr><tr><td><code>\\\\</code></td><td>反斜杠</td></tr><tr><td><code>\\&#39;</code></td><td>单引号</td></tr><tr><td><code>\\“</code></td><td>双引号</td></tr><tr><td><code>\\0nnn</code></td><td>八进制代码 nnn 表示的字符（n 是 0 到 7 中的一个八进制数字）</td></tr><tr><td><code>\\xnn</code></td><td>十六进制代码 nn 表示的字符（n 是 0 到 F 中的一个十六进制数字）</td></tr><tr><td><code>\\unnnn</code></td><td>十六进制代码 nnnn 表示的 Unicode 字符（n 是 0 到 F 中的一个十六进制数字）</td></tr></tbody></table><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/String" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="number"><a class="header-anchor" href="#number" aria-hidden="true">#</a> <code>number</code></h3><p>在<code>JavaScript</code>中，数字类型使用小数点或者不使用小数点均可。</p><div class="language-js"><pre><code><span class="token keyword">const</span> num <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> num2 <span class="token operator">=</span> <span class="token number">200104</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> num3 <span class="token operator">=</span> <span class="token number">0.3</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> num4 <span class="token operator">=</span> <span class="token number">0.1495</span><span class="token punctuation">;</span>\n</code></pre></div><h4 id="科学计数法"><a class="header-anchor" href="#科学计数法" aria-hidden="true">#</a> 科学计数法</h4><p>在超大或者是超小的数值上可以使用科学计数法。示例如下：</p><div class="language-js"><pre><code><span class="token keyword">const</span> num <span class="token operator">=</span> <span class="token number">123e5</span><span class="token punctuation">;</span> <span class="token comment">// 12300000</span>\n\n<span class="token keyword">const</span> num1 <span class="token operator">=</span> <span class="token number">123e-5</span><span class="token punctuation">;</span> <span class="token comment">// 0.00123</span>\n</code></pre></div><h4 id="特殊值"><a class="header-anchor" href="#特殊值" aria-hidden="true">#</a> 特殊值</h4><p>在<code>number</code>类型中，有几个特殊的值。</p><ul><li><code>Infinity</code> 表示无穷大</li><li><code>-Infinity</code> 表示无穷小</li><li><code>NaN</code> (Not a Number) 表示非数值类型</li></ul><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token number">Infinity</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> b <span class="token operator">=</span> <span class="token operator">-</span><span class="token number">Infinity</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> c <span class="token operator">=</span> <span class="token number">NaN</span><span class="token punctuation">;</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Number" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="boolean"><a class="header-anchor" href="#boolean" aria-hidden="true">#</a> <code>boolean</code></h3><p>在布尔值中，只有两个值：<code>true</code>和<code>false</code>。示例如下：</p><div class="language-js"><pre><code><span class="token keyword">const</span> bool <span class="token operator">=</span> <span class="token boolean">true</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> bool1 <span class="token operator">=</span> <span class="token boolean">false</span><span class="token punctuation">;</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Boolean" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="undefined"><a class="header-anchor" href="#undefined" aria-hidden="true">#</a> <code>undefined</code></h3><p><code>underfined</code>类型只有一个值，也就是<code>undefined</code>。</p><p>当一个变量在声明中没有初始化的时候，这个变量就默认为<code>undefined</code>。</p><div class="language-js"><pre><code><span class="token keyword">var</span> a<span class="token punctuation">;</span> <span class="token comment">// undefined</span>\n\n<span class="token keyword">let</span> b<span class="token punctuation">;</span> <span class="token comment">// undefined</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/undefined" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="null"><a class="header-anchor" href="#null" aria-hidden="true">#</a> <code>null</code></h3><p><code>null</code>代表为空值，但<code>null</code>与<code>undefined</code>的意义并不相同，<code>null</code>代表的是该变量已经初始化，但值为空，<code>undefined</code>代表的是该变量尚未初始化。</p><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> b <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">;</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/null" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="symbol"><a class="header-anchor" href="#symbol" aria-hidden="true">#</a> <code>symbol</code></h3><p><code>symbol</code>是<code>ES6</code>新引入的数据类型。</p><p><code>symbol</code>代表的是独一无二的值，最大的用法是用来定义对象的唯一属性名。</p><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;string&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> b <span class="token operator">=</span> <span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;string&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>a <span class="token operator">===</span> b<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// false</span>\n</code></pre></div><h4 id="symbol-for"><a class="header-anchor" href="#symbol-for" aria-hidden="true">#</a> <code>Symbol.for</code></h4><p>如果要使用同一个<code>Symbol</code>值的话，可以使用<code>Symbol</code>中的<code>for</code>方法。</p><ol><li>首先会在全局搜索被登记的<code>Symbol</code>中是否有该字符串参数作为名称的<code>Symbol</code>值</li><li>如果有即返回该<code>Symbol</code>值。</li><li>若没有则新建并返回一个以该字符串参数为名称的<code>Symbol</code>值，并登记在全局环境中供搜索</li></ol><div class="language-js"><pre><code><span class="token comment">//case1</span>\n<span class="token keyword">const</span> sym <span class="token operator">=</span> <span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;string&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> a <span class="token operator">=</span> Symbol<span class="token punctuation">.</span><span class="token function">for</span><span class="token punctuation">(</span><span class="token string">&#39;string&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>sym <span class="token operator">===</span> a<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//true</span>\n\n<span class="token comment">//case2</span>\n<span class="token keyword">const</span> b <span class="token operator">=</span> Symbol<span class="token punctuation">.</span><span class="token function">for</span><span class="token punctuation">(</span><span class="token string">&#39;string1&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> c <span class="token operator">=</span> <span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;string1&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>b <span class="token operator">===</span> c<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//false</span>\n</code></pre></div><h4 id="symbol-keyfor"><a class="header-anchor" href="#symbol-keyfor" aria-hidden="true">#</a> <code>Symbol.keyFor</code></h4><p><code>Symbol.keyFor</code>返回一个已登记的<code>Symbol</code>类型值的<code>key</code>。</p><p>用来检测该字符串参数作为名称的<code>Symbol</code>值是否已被登记。</p><div class="language-js"><pre><code><span class="token keyword">const</span> sym <span class="token operator">=</span> <span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;test&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nSymbol<span class="token punctuation">.</span><span class="token function">keyFor</span><span class="token punctuation">(</span>sym<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// test</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/symbol" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="bigint"><a class="header-anchor" href="#bigint" aria-hidden="true">#</a> <code>bigInt</code></h3><p><code>BigInt</code>是一种内置对象，它提供了一种方法来表示大于<code>2e53-1</code>的整数。</p><p>这原本是 <code>JavaScript</code>中可以用<code>Number</code>表示的最大数字。</p><p><code>BigInt</code>可以表示任意大的整数。</p><h4 id="用法"><a class="header-anchor" href="#用法" aria-hidden="true">#</a> 用法</h4><p>可以用在一个整数字面量后面加<code>n</code>的方式定义一个<code>BigInt</code>，如：<code>10n</code>，或者调用函数<code>BigInt()</code>。</p><div class="language-js"><pre><code><span class="token keyword">const</span> bigNumber <span class="token operator">=</span> <span class="token function">BigInt</span><span class="token punctuation">(</span><span class="token number">9007199254740991</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> bigNumber1 <span class="token operator">=</span> <span class="token number">9007199254740991n</span><span class="token punctuation">;</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>bigNumber <span class="token operator">===</span> bigNumber1<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//true</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/BigInt" target="_blank" rel="noopener noreferrer">MDN</a></p><h2 id="引用数据类型"><a class="header-anchor" href="#引用数据类型" aria-hidden="true">#</a> 引用数据类型</h2><h3 id="object"><a class="header-anchor" href="#object" aria-hidden="true">#</a> <code>object</code></h3><p>在<code>Javascript</code>里，对象可以被看作是一组属性的集合。</p><p>用对象字面量语法来定义一个对象时，会自动初始化一组属性。</p><p>在对象中，会以<code>key/value</code>的形式定义存储一个数据属性。<code>key</code>的值可以为<code>string</code>类型，也可以为<code>symbol</code>类型。<code>value</code>的值可以为任意值。</p><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token punctuation">{</span>\n    key<span class="token operator">:</span> <span class="token string">&#39;value&#39;</span><span class="token punctuation">,</span>\n    <span class="token punctuation">[</span><span class="token function">Symbol</span><span class="token punctuation">(</span><span class="token string">&#39;key&#39;</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token operator">:</span> <span class="token number">10000</span><span class="token punctuation">,</span>\n    key2<span class="token operator">:</span> <span class="token string">&#39;akaomf&#39;</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n</code></pre></div><p>对象可以以构造器函数创建，也可以字面量定义来创建。</p><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> b <span class="token operator">=</span> Object<span class="token punctuation">.</span><span class="token function">create</span><span class="token punctuation">(</span><span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre></div><p>每个对象对应一个内存地址。所以每定义一个对象，所分配的内存地址会不相同，即使他们看起来一样，但是实际上并不是同一个对象。</p><div class="language-js"><pre><code><span class="token keyword">const</span> a <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> b <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\n\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>a <span class="token operator">===</span> c<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//false</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/object" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="array"><a class="header-anchor" href="#array" aria-hidden="true">#</a> <code>array</code></h3><p>数组是一种使用整数作为键属性和长度属性之间关联的常规对象。</p><p>所以数组实际上也是对象。</p><div class="language-js"><pre><code><span class="token keyword">const</span> array <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">,</span> <span class="token number">2</span><span class="token punctuation">,</span> <span class="token number">3</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n<span class="token comment">//相当于</span>\n<span class="token keyword">const</span> object <span class="token operator">=</span> <span class="token punctuation">{</span>\n    <span class="token number">0</span><span class="token operator">:</span> <span class="token number">1</span><span class="token punctuation">,</span>\n    <span class="token number">1</span><span class="token operator">:</span> <span class="token number">2</span><span class="token punctuation">,</span>\n    <span class="token number">2</span><span class="token operator">:</span> <span class="token number">3</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/array" target="_blank" rel="noopener noreferrer">MDN</a></p><h3 id="function"><a class="header-anchor" href="#function" aria-hidden="true">#</a> <code>function</code></h3><p>函数实际上是对象。</p><p>每个函数都是<code>Function</code>类型的实例，而且与其他引用类型一样具有属性和方法。</p><p><code>function</code>可以通过<code>function</code>语句来声明，或者使用构造函数来创建，也可以使用<code>ES6</code>的箭头函数定义。</p><div class="language-js"><pre><code><span class="token keyword">const</span> <span class="token function-variable function">fn1</span> <span class="token operator">=</span> <span class="token keyword">function</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token comment">//todo something...</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">function</span> <span class="token function">fn2</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token comment">//todo something...</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">const</span> <span class="token function-variable function">fn3</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n    <span class="token comment">//todo something...</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> fn4 <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Function</span><span class="token punctuation">(</span><span class="token string">&#39;return 1 + 2&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//不推荐使用</span>\n<span class="token comment">//等同于</span>\n<span class="token keyword">function</span> <span class="token function">fn4</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    <span class="token keyword">return</span> <span class="token number">1</span> <span class="token operator">+</span> <span class="token number">2</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre></div><p>资料参考：<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/function" target="_blank" rel="noopener noreferrer">MDN</a></p>',79);o.render=function(a,e,o,p,c,l){return n(),s("div",null,[t])};export default o;export{e as __pageData};
